import React from 'react';
import { Link } from "react-router-dom";

export const Content = () => {
    return<nav>
    <ul>
      <li>  <Link  to="/WorkersList"> Workers </Link></li>
      <li>  <Link to="/ServicesList"> Services </Link> </li>
      <li>  <Link to="/StockList"> Stock </Link></li>
    </ul>
  </nav>
}
